import React from 'react';

function Note(prop){

    function handleClick(){
        props.onDelete(props.id);
    }

    return (
        <div className="note">
            <h1>{prop.title}</h1>
            <p>{prop.content}</p>
            <button>Delete</button>
        </div>
    );
}

export default Note;
